import React from 'react'
import './Navbar.css'

class Navbar extends React.Component{
    render(){
        return (
            <nav>
                <h1>Hello</h1>
                <ul class="nav-links">
                    <li>Home</li>
                    <li>Contact</li>
                    <li>Services</li>
                </ul>
            </nav>
        )
    }
}

export default Navbar
